import React from 'react';

const Footer = () => {
  return (
    <div className="Footer">
      <a href="https://github.com/martham0">
        <img src="../img/github.png"></img>
      </a>
      <a href="https://www.linkedin.com/in/mmartham/">
        <img src="../img/linkedIn.png" alt=""></img>
      </a>
    </div>
  );
};

export default Footer;
